import React from 'react';
import SubHeading from '../../components/sub/SubHeading';
import assets from '../../material/assets';
import './header.css';

const Header = () => (
<div className="app_header app__wrapper section__padding" id="home">
    <div className="app__wrapper_info">
     <SubHeading title="Chase the new flavour" />
        <h1 className="app__header-h1">Come Gather At Our Table</h1>
        <p className="p__opensans" style={{ margin: '2rem 0' }}>Sit tellus lobortis sed senectus vivamus molestie. Condimentum volutpat morbi facilisis quam scelerisque sapien. Et, penatibus aliquam amet tellus </p>
        <button type="button" className="custom__button">Explore Menu</button>
    </div>
      <div className="app__wrapper_img">
        <img src={assets.drinks1} alt="header_img" />
      </div>
  </div>
);

export default Header;
